@julio_ecs Hay unos sinvergüenzas que ocupan y detienen un carril con el uso de las luces de emergencia.
Pero no hay tal emergencia, esperan a un familiar amigo baje o suba al carro. Miéntras tanto, puede pasar 1 minuto y se forma fila de 2 cuadras.
